import types from "./../types/typeOfActions";
import callApi from "./../callApi/callApi";
class Products {
  getAllProducts = () => {
    return async (dispatch) => {
      let result = await callApi(`http://localhost:9000/products`);
      dispatch({
        type: types.GET_ALL_
      })
    };
  };
}
export default new Products();
